import React from 'react';
import Card from "./Card"

const cardlist = ({robots2} )=> {
    const Card2= robots2.map( (user,i)=>{
        return(
            <div>
                <Card id={user[i].id} name={user[i].name} email={user[i].email} />
            </div>
        )
    } )
    return(
        <div>
            {Card2}
        </div>
    )
}

export default cardlist
